    false,nt"url": null,nt"notes": "This classification of estimated depth
    represents the relative bathymetry of Puerto Rico's shallow waters based on Landsat
    imagery for NOAA's Coastal Centers for Monitoring and Assessment (CCMA). This data
    supports mapping and research activities of NOAA NOS. These data were created for
    the NOS Summit-to-Sea project. This project determines relationships between terrestrial
    and benthic change. The data were created using NOS developed algorithms. Bathymetry
    was derived from six Landsat images of different dates for Puerto Rico. The final
    bathymetry layer was derived from a per pixel median analysis of the 6 bathymetric
    layers. The results were verified using field collected depth supplied by NOAA.
    Depths are only reported within the shallow environment as determined by maximum
    penetration of band 1 (blue) of Landsat TM.",nt"license_title": null,nt"extras":
